import { CollapsibleList, ListItem, ListItemIcon, ListItemBadge } from "./List";
import { UserType, ChannelType } from "../main/types";
import { channel } from "diagnostics_channel";

type Props = {
  users: UserType[];
  channels: ChannelType[];
  selectedUserId: string;
  onUserChange: any;
  onChannelChange: any;
};

export function Sidebar({
  users,
  channels,
  selectedUserId,
  onUserChange,
  onChannelChange,
}: Props) {
  return (
    <div className="sidebar">
      <header className="sidebar__header"></header>
      <CollapsibleList title="Channels" onChange={onChannelChange}>
        {channels.map((channel) => (
          <ListItem>
            <ListItemIcon />
            <ListItemText />
            <ListItemBadge />
          </ListItem>
        ))}
      </CollapsibleList>
      <CollapsibleList
        title="Direct messages"
        selectedId={selectedUserId}
        onChange={onUserChange}
      />
    </div>
  );
}
